  false,\n\t\"url\": null,\n\t\"notes\": \"Volunteers have since 2004 undertaken a
  refugeu2013wide, GPS-based invasive plant survey and assisted with our Early Detection
  and Rapid Response Program (EDRRP). Past surveys have resulted in the location of
  several previously unknown populations of spotted and Russian Knapweed, yellow starthistle
  and medusa head wild-rye which received rapid response control actions (manual removal,
  chemical application, and biocontrol). The refuge has recently purchased several
  tracts that need to be surveyed and mapped. Turnbullu2019s Environmental Education
  Program hosts over 3,700 students per year on refuge. This program provides an opportunity
  to educate students through an invasive species display at the refugeu2019s indoor
  classroom about the impacts of animal and plant invasive species to native ecosystems,
  their identification, and prevention measures. Funding from this grant will allow
  for the purchase of a new GPS Unit, bio control agents, chemicals and application
  equipment to facilitate the rapid response phase of the project, purchase of linedrawings
  of invasive species and taxidermy mounts of invasive animal species for the display,
  and to hire either an AmeriCorps member or independent contractor through the Refugeu2019s
  Friendu2019s Group. The AmeriCorps member/contractor will assist with coordinating
  the Refuge EDRRP through the summer of 2015. The AmeriCorps member/contractor, Refuge
  Wildlife Biologist, Visitor Service Manager and Friends of Turnbull NWR will recruit,
  and train volunteers in the use of GPS equipment, survey software, EDRRP protocols,
  and work with volunteers to develop the invasive species display for the EE classroom.\",\n\t\"license_title\":
